import React, { Fragment, useState } from "react";
import { Button, Container, Segment } from "semantic-ui-react";
import { ISector } from "../../app/models/sector";
import '../../app/layout/styles.css';


interface IProps {
  sectors:ISector[];
  // selectActivity: (id: string) => void;
  // selectedActivity: IActivity | null;
  // editMode: boolean;
  // setEditMode: (editMode: boolean) => void;
  // setSelectedActivity: (activity: IActivity | null) => void;
  // createActivity: (activity: IActivity) => void;
  // editActivity: (activity: IActivity) => void;
  // deleteActivity: (id: string) => void;
}

  const Kategorite: React.FC<IProps> = ({
    sectors,
    // selectProduct,
    // selectedProduct,
    // editMode,
    // setEditMode,
    // setSelectedProduct,
    // createProduct,
    // editProduct,
    // deleteProduct,
    // openCreateForm
  }) => {
    return (
      <Container className="kategoria">
        {sectors.map((sector) => (
          <Button.Group key={sector.sectorId}>
            <Segment basic color="black" textAlign="justified">
              <Button.Content>{sector.sectorName}</Button.Content>
            </Segment>
          </Button.Group>
        ))}
      </Container>
    );
  };
  
  export default Kategorite;
